import React from 'react';
import './css/BeerCol.css';

function BeerCol(props) {
  return (
    <div>
        <div className="d-flex justify-content-end align-items-center"></div>
        <div className="d-flex justify-content-end align-items-center">
            <img className="w-40" src={props.attributes.img} alt="Beer"></img>
            <div className="w-60">
                <h1>{props.attributes.name}</h1>
                <div>{props.attributes.description}</div>
            </div>
        </div>
    </div>
  ); 
}

export default BeerCol;
